    function filterList() {
      var key = $('#key').val();
      var temp = '';
      if (key.length > 2) {
        var filteredList = list.filter(item => item.search(key) > -1);
        if(filteredList.length) {
          temp = `<table class="table table-responsive">
            <thead>
            <tr>
              <th>Name</th>
              <th>Phone</th>
              <th>Action</th>
            </tr>
            </thead>
            <tbody>`;


          filteredList.forEach((item, index) => {

           var fra = item.split(',') ;
           temp += `<tr>
              <td>${fra[1]}</td>
              <td>${fra[2]} </td>
              <td><button class="btn btn-primary btn-lg active" onclick="showData('${item}');" type="button">More</button><button class="btn btn-danger btn-lg active" type="button" onclick="copyData('${fra[2]}');">Ok</button></td>

            </tr>`;
          });
          temp += `</tbody>
          </table>`;
        } else {
          temp += `<div class="alert alert-danger">
  <strong>!!!</strong> No result found.
</div> <br><br>`;
          temp +=
                  '<a href="https://registration.isminspire.com" class="btn btn-primary btn-lg active" role="button" aria-pressed="true">Register</a>';

        }

</div>`;

      }

      $('#resultHolder').html(temp);


    }
